import React from 'react'
import { Link } from 'react-router-dom'
const HomeContent = () => {

  const myStyle={
    backgroundImage: `url('/welcome.jpg')`, // Use the correct path to your image
    backgroundSize: 'cover', // Adjust as needed
    backgroundRepeat: 'no-repeat',
  }

  return (
    <>
      <div className="row">
        <div className="col">
          <div className="btn btn-md m-2" style={{background : 'rgba(139,129,218,255)',color : 'white'}}><i className="fa-regular fa-square-plus"></i> Add TODO</div>
          <div className="btn btn-md m-2 " style={{background : 'rgba(139,129,218,255)',color : 'white'}}><i className="fa-regular fa-square-plus"></i>Add Note</div>
        </div>
        <div className="col" style={myStyle}>
          {/* <img src="/welcome.jpg" style={{width :'30em' , height : '30em' }} alt=""/> */}
        </div>
      </div>
    </>
  )
}

export default HomeContent
